import React, { useState } from 'react';
import { Form, Button, Card, Row, Col } from 'react-bootstrap';

const QueryForm = ({ query, tableIndex, queryIndex, formData, setFormData }) => {
  const [newKey, setNewKey] = useState('');
  const [newValue, setNewValue] = useState('');

  const handleQueryTypeChange = (e) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].query[queryIndex].queryType = e.target.value;
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleQueryNameChange = (e) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].query[queryIndex].QueryName = e.target.value;
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleQueryOrderChange = (e) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].query[queryIndex].QueryOrder = e.target.value;
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleQueryFileNameChange = (e) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].query[queryIndex].QueryFileName = e.target.value;
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleAddParameter = () => {
    if (newKey.trim() && newValue.trim()) {
      const newReportName = [...formData.ReportName];
      newReportName[0].tables[tableIndex].query[queryIndex].queryParameter[newKey.trim()] = newValue.trim();
      setFormData({ ...formData, ReportName: newReportName });
      setNewKey('');
      setNewValue('');
    }
  };

  const handleRemoveParameter = (key) => {
    const newReportName = [...formData.ReportName];
    delete newReportName[0].tables[tableIndex].query[queryIndex].queryParameter[key];
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleRemoveQuery = () => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].query = newReportName[0].tables[tableIndex].query.filter((_, i) => i !== queryIndex);
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handleAddPrimaryKey = () => {
    if (newKey.trim()) {
      const newReportName = [...formData.ReportName];
      if (!newReportName[0].tables[tableIndex].PrimaryKey) {
        newReportName[0].tables[tableIndex].PrimaryKey = [];
      }
      newReportName[0].tables[tableIndex].PrimaryKey.push(newKey.trim());
      setFormData({ ...formData, ReportName: newReportName });
      setNewKey('');
    }
  };

  const handleRemovePrimaryKey = (keyIndex) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].PrimaryKey = newReportName[0].tables[tableIndex].PrimaryKey.filter((_, i) => i !== keyIndex);
    setFormData({ ...formData, ReportName: newReportName });
  };

  const handlePartitionColumnChange = (e) => {
    const newReportName = [...formData.ReportName];
    newReportName[0].tables[tableIndex].PartitionColumn = e.target.value;
    setFormData({ ...formData, ReportName: newReportName });
  };

  return (
    <Card className="mb-3">
      <Card.Body>
        <div className="d-flex justify-content-between align-items-center mb-3">
          <h6 className="mb-0">Query {queryIndex + 1}</h6>
          <Button variant="danger" onClick={handleRemoveQuery} className="dhl-button">
            Remove Query
          </Button>
        </div>
        <Row className="mb-3">
          <Col md={3}>
            <Form.Group>
              <Form.Label className="fw-bold">Query Type</Form.Label>
              <Form.Select
                value={query.queryType}
                onChange={handleQueryTypeChange}
                required
                className="dhl-select"
                style={{ height: '34px' }}
              >
                <option value="SQL">SQL</option>
                <option value="SPARK">SPARK</option>
              </Form.Select>
            </Form.Group>
          </Col>
          <Col md={3}>
            <Form.Group>
              <Form.Label className="fw-bold">Query Name</Form.Label>
              <Form.Control
                type="text"
                value={query.QueryName}
                onChange={handleQueryNameChange}
                required
                className="dhl-select"
                style={{ height: '34px' }}
              />
            </Form.Group>
          </Col>
          <Col md={3}>
            <Form.Group>
              <Form.Label className="fw-bold">Query Order</Form.Label>
              <Form.Control
                type="text"
                value={query.QueryOrder}
                onChange={handleQueryOrderChange}
                required
                className="dhl-select"
                style={{ height: '34px' }}
              />
            </Form.Group>
          </Col>
          <Col md={3}>
            <Form.Group>
              <Form.Label className="fw-bold">Query File Name</Form.Label>
              <Form.Control
                type="text"
                value={query.QueryFileName}
                onChange={handleQueryFileNameChange}
                required
                className="dhl-select"
                style={{ height: '34px' }}
              />
            </Form.Group>
          </Col>
        </Row>

        {formData.ReportName[0].tables[tableIndex].WriteMode === 'MERGE' && (
          <div className="mb-3">
            <h6 className="mb-2">Primary Keys</h6>
            <Row className="mb-2">
              <Col md={10}>
                <Form.Control
                  type="text"
                  value={newKey}
                  onChange={(e) => setNewKey(e.target.value)}
                  placeholder="Enter primary key"
                  className="dhl-select"
                  style={{ height: '34px' }}
                />
              </Col>
              <Col md={2}>
                <Button
                  variant="secondary"
                  onClick={handleAddPrimaryKey}
                  className="dhl-button w-100"
                  disabled={!newKey.trim()}
                  style={{ height: '34px' }}
                >
                  Add Key
                </Button>
              </Col>
            </Row>
            {formData.ReportName[0].tables[tableIndex].PrimaryKey && 
             formData.ReportName[0].tables[tableIndex].PrimaryKey.length > 0 && (
              <div className="primary-keys-list">
                {formData.ReportName[0].tables[tableIndex].PrimaryKey.map((key, keyIndex) => (
                  <div key={keyIndex} className="d-flex align-items-center gap-2 mb-1">
                    <Form.Control
                      type="text"
                      value={key}
                      disabled
                      className="dhl-select bg-light"
                      style={{ height: '34px' }}
                    />
                    <Button
                      variant="link"
                      className="text-danger p-0"
                      onClick={() => handleRemovePrimaryKey(keyIndex)}
                      style={{ height: '34px', lineHeight: '34px' }}
                    >
                      Remove
                    </Button>
                  </div>
                ))}
              </div>
            )}
          </div>
        )}

        {formData.ReportName[0].tables[tableIndex].WriteMode === 'PARTITION_OVERWRITE' && (
          <div className="mb-3">
            <h6 className="mb-2">Partition Column</h6>
            <Row>
              <Col md={12}>
                <Form.Control
                  type="text"
                  value={formData.ReportName[0].tables[tableIndex].PartitionColumn || ''}
                  onChange={handlePartitionColumnChange}
                  placeholder="Enter partition column name"
                  required
                  className="dhl-select"
                  style={{ height: '34px' }}
                />
              </Col>
            </Row>
          </div>
        )}

        <div className="mb-3">
          <h6 className="mb-2">Query Parameters</h6>
          <Row className="mb-2">
            <Col md={5}>
              <Form.Control
                type="text"
                value={newKey}
                onChange={(e) => setNewKey(e.target.value)}
                placeholder="Parameter Key"
                className="dhl-select"
                style={{ height: '34px' }}
              />
            </Col>
            <Col md={5}>
              <Form.Control
                type="text"
                value={newValue}
                onChange={(e) => setNewValue(e.target.value)}
                placeholder="Parameter Value"
                className="dhl-select"
                style={{ height: '34px' }}
              />
            </Col>
            <Col md={2}>
              <Button
                variant="secondary"
                onClick={handleAddParameter}
                className="dhl-button w-100"
                disabled={!newKey.trim() || !newValue.trim()}
                style={{ height: '34px' }}
              >
                Add
              </Button>
            </Col>
          </Row>
          {Object.entries(query.queryParameter).map(([key, value]) => (
            <div key={key} className="d-flex align-items-center gap-2 mb-1">
              <Form.Control
                type="text"
                value={key}
                disabled
                className="dhl-select bg-light"
                style={{ height: '34px' }}
              />
              <Form.Control
                type="text"
                value={value}
                disabled
                className="dhl-select bg-light"
                style={{ height: '34px' }}
              />
              <Button
                variant="link"
                className="text-danger p-0"
                onClick={() => handleRemoveParameter(key)}
                style={{ height: '34px', lineHeight: '34px' }}
              >
                Remove
              </Button>
            </div>
          ))}
        </div>
      </Card.Body>
    </Card>
  );
};

export default QueryForm;
